import logo from './logo.svg';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="content">
        <Container>
        <div className="header">Bear Pals</div>
        We match you with study groups to help you ace your classes.
        </Container>
      </div>
    </div>
  );
}

export default App;
